const divArticle = document.createElement('div');
const article = document.createElement('article');

arrayRecipes.forEach( (element) =>{
  const elementArticle = document.createElement('div');
  elementArticle.className = 'row';
  elementArticle.style.border = 'thick solid #ef6c00';

  const elementArticleTAR = document.createElement('div');
  elementArticleTAR.className = 'col-8';
  const elementArticleIMG = document.createElement('div');
  elementArticleIMG.className = 'col-4';

  const img = document.createElement('img');
  img.src = element.image;

  const rowArticleTitle = document.createElement('div');
  const divArticleTitle = document.createElement('div');
  divArticleTitle.className = 'col-12';
  const titleArticle = document.createElement('h3');
  titleArticle.innerHTML = element.title;
  titleArticle.style.color = 'white';

  const rowArticleAuthor = document.createElement('div');
  const divArticleAuthor = document.createElement('div');
  divArticleAuthor.className = 'col-12';
  const authorArticle = document.createElement('h5');
  authorArticle.innerHTML = element.author;
  authorArticle.style.color = 'white';

  const rowArticleDescription = document.createElement('div');
  const divArticleDescription = document.createElement('div');
  divArticleDescription.className = 'col-12';
  const descriptionArticle = document.createElement('p');
  descriptionArticle.innerHTML = element.description;
  descriptionArticle.style.color = 'white';

  divArticleDescription.appendChild(descriptionArticle);
  rowArticleDescription.appendChild(divArticleDescription);
  divArticleTitle.appendChild(titleArticle);
  rowArticleTitle.appendChild(divArticleTitle);
  divArticleAuthor.appendChild(authorArticle);
  rowArticleAuthor.appendChild(divArticleAuthor);

  elementArticleTAR.appendChild(rowArticleTitle);
  elementArticleTAR.appendChild(rowArticleAuthor);
  elementArticleTAR.appendChild(rowArticleDescription);
  elementArticleIMG.appendChild(img);
  elementArticle.appendChild(elementArticleTAR);
  elementArticle.appendChild(elementArticleIMG);
  article.appendChild(elementArticle);
});

